import React, {Component} from "react";
import ListContainer from "./ListContainer";
import Header from "./Header";


class RootContainer extends Component{
	render() {
		return (
			<div>
				<Header className="App-header"/>

				<ListContainer/>

			</div>
		)
	}
}

export default RootContainer
